import img1 from './images/Ikagai.jpg';
import img2 from './images/atomic habits.jpg';
import img3 from './images/psychology of money.jpg';
export const books = [
 {
  author:'Francesc Miralles',
  title: "Ikigai: Japanese secret to long and happy life",
  img: img1,
  id: 1,
 },
 {
  author:'Atomic Habits',
  title: "Atomic Habits",
  img: img2,
  id: 2,
 },
 {
  author:'Morgan Housel',
  title:'Psychology of Money',
  img: img3,
  id: 3,
 },

];
